import "./App.css";
import React, { useState } from "react";
import { SearchBook } from "./components/searchBook";
import { Home } from "./components/home";

const App = () => {
  const [showSearchPage, setShowSearchpage] = useState(false);
  const [shelves, setShelves] = useState({});

  return (
    <div className="app">
      {showSearchPage ? <SearchBook showSearchPage={showSearchPage} setShowSearchpage={setShowSearchpage} shelves={shelves} setShelves={setShelves} /> : <Home showSearchPage={showSearchPage} setShowSearchpage={setShowSearchpage} shelves={shelves} setShelves={setShelves} />
      }
    </div>
  );
}

export default App;
